import React from "react";

const courses = [
    {
        _id: "123",
        title: "CS4550"
    },
    {
        _id: "234",
        title: "CS4500"
    },
    {
        _id: "345",
        title: "CS3200"
    }
]
const CourseListComponents = ({instructor, term}) => {
    return (
        <div>
        <h1>Course List(for{instructor}) {term}</h1>
        <table>
            {
                courses.map(function (item, index) {
                    return<tr><td>{item.title}</td></tr>
                })
            }
        </table>
        </div>
    )
}

export default CourseListComponents;
